function component(a,t){let{alterA:e,alterB:r,alterC:o,alterD:l,id:s,enuciado:c,alternativaCorreta:i}=a[t];var d=["#2f6dae","#2c9ca6","#004d40","#eca82c","#d4546a","black","#1976d2","#26a69a","#9e9d24","#e65100","#795548","#607d8b"];const n=4;var p=d.sort(function(){return.5-Math.random()}).slice(0,n),v=[{texto:`<div title="Clique para marcar essa resposta como certa." \n  class="col s3 m4 l3 alternativa" data-value="a"><p style="background-color: ${p[0]};">${e.toUpperCase()}</p></div>`},{texto:`<div title="Clique para marcar essa resposta como certa." \n  class="col s3 m4 l3 alternativa" data-value="b"><p style="background-color: ${p[1]};">${r.toUpperCase()}</p></div>`},{texto:` \n  <div title="Clique para marcar essa resposta como certa." \n  class="col s3 m4 l3 alternativa" data-value="c"><p style="background-color: ${p[2]};">${o.toUpperCase()}</p></div>`},{texto:`<div title="Clique para marcar essa resposta como certa." \n  class="col s3 m4 l3 alternativa" data-value="d"><p style="background-color:${p[3]};">${l.toUpperCase()}</p></div>`}];v.sort(function(){return.5-Math.random()});let u=`<div class="main" hidden>\n    <div class="titulo">\n    <h1>${c}</h1>\n    </div>\n    <div class="row">\n    <div class="col s12 m12 l12">`;for(let a of v)u+=a.texto;return u+=`<input type="hidden" value="${i}" id="resposta-correta" />\n    <input type="hidden" value="${s}" id="questao-id" />\n    </div>\n    </div>\n    </div>`,u}